              </div>
              <div>
              <h4 className="h5">Jetzt bis zu 600€ zurück erhalten!</h4>
              </div>
              <div>
                <h4 className="h5">Exklusiv Betreeung für Chinesische Kunden</h4>

              </div>
              <div>

              </div>

          </div>

    </form>
    );
  }
}

BelowLanding.propTypes = {
  classes: PropTypes.object.isRequired,
};

export default withStyles(styles)(BelowLanding);
